import React from "react";
import styles from "./button.module.css";

const button = (props, { style, clicked, children }) => {
  return (
    <button
      className={styles.btn}
      onClick={clicked}
      style={{ ...style }}
      {...props}
    >
      {children}
    </button>
  );
};
export default button;
